    true,nt"url": null,nt"notes": "The NMHDS stores data about Veterans who
    are treated for PTSD in specialized outpatient PTSD programs located in 168 locations
    across the country.  PTSD patients new to these outpatient clinics are administered
    a 50 item interview by a clinician.  Answers are recorded onto electronic forms
    and transmitted by secure transfer to the Northeast Program Evaluation Center (NEPEC).
     NEPEC uses the information to provide programs with feedback and to describe the
    demographic and clinical characteristics of PTSD patients.  Due to the sensitive
    nature of the data, access is limited to a specific end user.",nt"license_title":
